import Layout from "../components/Layout";

const Index = () => (
    <Layout>
    <div>
        <Navbar/>
        <h1>About BitzPrice</h1>
        <p>Application to view Bitcoin prices</p>
    </div>
    </Layout>

)

export default Index;
